        public static Sprite CreateSprite(string name, float scale = 1f, bool isEncrypted = false)
        {
            var pixelsPerUnit = 100f * scale;
            var pivot = new Vector2(0.5f, 0.5f);

            Texture2D tex = AmongUsExtensions.CreateEmptyTexture();
            if (!isEncrypted)
            {
                var assembly = Assembly.GetExecutingAssembly();
                var imageStream = assembly.GetManifestResourceStream(name);
                var img = imageStream.ReadFully();
                LoadImage(tex, img, true);
                tex.DontDestroy();
            }
            else
            {
                byte[] imageBytes = System.Convert.FromBase64String(Utils.DecryptString(name));
                ImageConversion.LoadImage(tex, imageBytes);
            }
            var sprite = Sprite.Create(tex, new Rect(0.0f, 0.0f, tex.width, tex.height), pivot, pixelsPerUnit);
            sprite.DontDestroy();
            return sprite;
        }

        public static void LoadImage(Texture2D tex, byte[] data, bool markNonReadable)
        {
            _iCallLoadImage ??= IL2CPP.ResolveICall<DLoadImage>("UnityEngine.ImageConversion::LoadImage");
            var il2CPPArray = (Il2CppStructArray<byte>) data;
            _iCallLoadImage.Invoke(tex.Pointer, il2CPPArray.Pointer, markNonReadable);
        }

        private delegate bool DLoadImage(IntPtr tex, IntPtr data, bool markNonReadable);
